package SeleniumClass;

public class WhileLoopNamePrint {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=1;
		while(i<=5) {
			//System.out.println("Tina");
			System.out.println(i+"."+"Tina");
			i++;
		}
		
		System.out.println("------------------------------------------------------------------");
		int j=1;
		while(j<=5) {
			System.out.println("Tina");
			//System.out.println(i+"."+"Tina");
			j++;
		}

	}

}
